import React from 'react';
import { Collapse, Button } from 'react-bootstrap';

 const Tools = ({handleHint, collapseOpen, handleExplore}) => {

  const style={
    background: '#2492ff',
    margin: '10px',
    minwidth: '100px',
  }

   return ( 
<div>
    <Button style={style}
     onClick ={() => handleHint()}
   aria-expanded={collapseOpen}
  >
    Hint
  </Button>

  <Button style={style}
     onClick ={() => handleExplore()}
  >
  Explore
  </Button>

    <Collapse in={collapseOpen}>
    <div id="example-collapse-text">
